INSERT INTO `alerts` VALUES (34,'2022-10-29 18:30:00.000000','2022-11-01 21:10:00.000000','Alertă ANM: Cod Galben  de caniculă severă în  județele Caraş-Severin și Hunedoara','Feugiat in fermentum posuere urna. Amet cursus sit amet dictum. Neque gravida in fermentum et sollicitudin ac orci phasellus egestas. Viverra nibh cras pulvinar mattis nunc sed blandit. Nullam ac tortor vitae purus. Accumsan tortor posuere ac ut consequat semper.\n\nFames ac turpis egestas sed tempus urna et pharetra. Lectus proin nibh nisl condimentum id. Vivamus at augue eget arcu. Donec ultrices tincidunt arcu non.\n\nLorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Cursus vitae congue mauris rhoncus aenean vel elit scelerisque. Adipiscing elit ut aliquam purus sit amet luctus venenatis.\n\nNisl condimentum id venenatis a condimentum vitae. Euismod quis viverra nibh cras pulvinar mattis nunc sed. A cras semper auctor neque vitae tempus quam pellentesque. Tortor pretium viverra suspendisse potenti nullam ac. Gravida cum sociis natoque penatibus et magnis dis parturient montes .','2022-10-21 21:06:45.436000','2022-10-31 15:54:14.019000','2022-10-31 14:45:47.148000',NULL,1,'ro');
