INSERT INTO `articles` VALUES (7,'IGSU: Misiunile desfășurate de salvatori, în ultimele 24 de ore','Stingerea incendiilor, acordarea de prim ajutor, descarcerarea, deblocarea sau salvarea persoanelor și animalelor din medii ostile vieții reprezintă doar câteva exemple dintre cele 1.443 misiuni desfășurate de salvatori, în ultimele 24 de ore (18.10.2022).\n\nLa nivel național, 1.267 de persoane au primit ajutorul echipajelor SMURD, cele mai multe situații fiind înregistrate în zona București-Ilfov (291 cazuri), urmată de județele Cluj (63 cazuri), Timiș (58 cazuri) și Mureș (56 cazuri).\n\nÎn afara acestor situații, echipajele operative au intervenit pentru stingerea a 48 de incendii, precum și în alte 147 de intervenții în sprijinul comunităților.\n\nO atenție deosebită a fost alocată și accidentelor rutiere, echipajele de descarcerare acționând în 9 situații pentru extragerea victimelor blocate în autoturisme. \n\nTotodată, în perioada de referință, pe timpul misiunilor desfășurate pompierii militari au salvat 5 persoane aflate în dificultate. \n\nDintre cele mai relevante misiuni, amintim: \n\n❗O intervenție care a presupus atenție sporită din partea echipajelor de descarcerare și prim ajutor a avut loc ieri, în județul Vrancea, pe raza municipiului Adjud, DN 2, unde pompierii militari au intervenit pentru gestionarea urmărilor unui accident rutier produs între trei autoturisme. În urma impactului au rezultat trei victime, dintre care două încarcerate, în stop cardio-respirator. Echipajele de intervenție au extras persoanele blocate în autoturism și au aplicat manevre de resuscitare, însă fără rezultat. Colegii noștri au asistat și evaluat medical cel de-al treilea ocupant al autoturismului, ulterior acesta fiind transportat la spital conștient și cooperant.\n\n❗O misiune complexă a salvatorilor militari din municipiul Iași a avut loc ieri când au fost solicitați să intervină la un accident rutier produs între un autoturism și o basculantă. Ajunși la locul solicitării, colegii noștri au constatat că în urma evenimentului rutier au rezultat două victime încarcerate, dintre care una inconștientă în stop cardio-respirator. Echipajele de descarcerare au scos cele două persoane dintre fiarele contorsionate și echipajele SMURD au aplicat manevre de resuscitare. Ulterior, ambii tineri au fost transportați la spital pentru asistență medicală de specialitate. \n\nPentru acoperirea în cele mai bune condiții a misiunilor din dinamică, 248 de pompieri salvatori cu 159 de mijloace tehnice se află la granița cu Republica Moldova și Ucraina, pentru gestionarea afluxului de persoane care intră pe teritoriul României.\n\nÎn continuare, pompierii salvatori rămân mobilizați, 24 de ore din 24, pentru gestionarea operativă a situaţiilor de urgenţă şi acordarea primului ajutor medical specializat persoanelor aflate în dificultate. \n\nEvenimentele înregistrate la nivel național rămân în atenția Centrului Operațional Național, pentru dispunerea imediată a măsurilor menite să asigure optimizarea misiunilor de răspuns orientate spre salvarea de vieți.\n \nNu uitați! Informații despre modul de comportare în cazul producerii unor situații de urgență pot fi obținute prin accesarea platformei naționale de pregătire în situații de urgență https://fiipregatit.ro','2022-10-21 21:06:45.646000','2022-10-29 08:39:53.967000','2022-10-19 09:00:36.830000',NULL,1,'ro'),(9,'IGSU: Misiunile desfășurate de salvatori, în ultimele 24 de ore','Bilanțul zilei de luni: 16 persoane aflate în dificultate au fost salvate, iar alte 1.222 au fost asistate medical de echipajele SMURD \n\nZiua de ieri, 17 octombrie a.c., a fost solicitantă pentru echipajele operative din întreaga țară, cele mai numeroase misiuni fiind derulate în zona București-Ilfov și în județele Mureș, Prahova, Constanța și Cluj.\n\nO pondere de aproximativ 85% din totalul intervențiilor a constat în acordarea asistenței medicale de către echipajele SMURD ( 1.206 cazuri din totalul de 1.435 situații de urgență gestionate ).\n\nDe asemenea, pompierii salvatori au acționat pentru localizarea și stingerea celor 66 de incendii înregistrate la nivel național și au gestionat cu promptitudine 159 misiuni pentru protecția comunităților.\n\nO atenție deosebită a fost alocată și accidentelor rutiere, echipajele de descarcerare acționând în 4 situații pentru extragerea victimelor blocate în autoturisme.\n\nTotodată, în perioada de referință, pe timpul misiunilor desfășurate, pompierii militari au salvat 16 persoane aflate în dificultate.\n\nÎn ultimele 24 de ore au fost transmise 4 mesaje de avertizare a populației prin sistemul RO-ALERT, dintre care 3 mesaje privind prezența animalelor sălbatice, în județele Harghita (2) și Mureș (1); 1 mesaj privind dispariția de la domiciliu a unui minor, transmis de IGSU, în județul Bacău.\n\nDintre cele mai relevante intervenții, amintim:\n\n \n\n❗O misiune complexă a avut loc ieri, în județul Gorj, localitatea Bumbești-Pițic, unde pompierii militari au fost solicitați să intervină pentru localizarea și lichidarea unui incendiu izbucnit la o casă. Ajunse la fața locului, echipajele de stingere au constatat că flăcările se manifestau violent, la un imobil și două anexe pe o suprafață de aproximativ 180 mp. Pe timpul misiunii de stingere, în interiorul locuinței a fost găsită o persoană decedată. Colegii noștri au stins flăcările, înlăturând pericolul extinderii la locuințele aflate în vecinătate.\n\n❗O intervenție care a necesitat atenție sporită și efort susținut a avut loc pe parcursul zilei de ieri, în județul Buzău, unde echipajele operative au acționat pentru stingerea flăcărilor izbucnite la trei imobile din localitatea Siriu. Echipajele de stingere ajunse la locul solicitării au constatat că arderea se manifesta cu degajări mari de fum, la trei imobile, pe o suprafață de aproximativ 200 mp. Pe parcursul acțiunii de lichidare a incendiului, echipajele SMURD au evaluat și asistat medical patru persoane, ulterior trei dintre acestea au fost transportate la spital pentru investigații medicale de specialitate. Flăcările au fost lichidate în limitele găsite.\n\nPentru acoperirea în cele mai bune condiții a misiunilor din dinamică, 219 pompieri salvatori cu 160 de mijloace tehnice se află la granița cu Republica Moldova și Ucraina, pentru gestionarea afluxului de persoane care intră pe teritoriul României.\n\nSalvatorii rămân la datorie pentru intervenția promptă la solicitările cetățenilor aflați în dificultate, iar dinamica evenimentelor din teren va fi atent monitorizată de Centrul Operațional Național, pentru dispunerea imediată a măsurilor necesare optimizării misiunilor de răspuns.\n\nNu uitați! Informații despre modul de comportare în cazul producerii unor situații de urgență pot fi obținute prin accesarea platformei naționale de pregătire în situații de urgență https://fiipregatit.ro','2022-10-21 21:06:45.659000','2022-10-29 08:40:31.668000','2022-10-19 09:34:39.975000',NULL,1,'ro'),(10,'IGSU: Missions carried out by rescuers in the last 24 hours','Extinguishing fires, providing first aid, extricating, unlocking or rescuing people and animals from hostile environments are just a few examples of the 1,443 missions carried out by rescuers in the last 24 hours (18.10.2022).\n\nAt the national level, 1,267 people received the help of SMURD crews, the most cases being recorded in the Bucharest-Ilfov area (291 cases), followed by the counties of Cluj (63 cases), Timiș (58 cases) and Mureș (56 cases).\n\nApart from these situations, operative crews intervened to extinguish 48 fires, as well as in 147 other interventions in support of communities.\n\nSpecial attention was also paid to road accidents, with rescue crews acting in 9 situations to extract victims stuck in cars.\n\nAt the same time, during the reference period, during the missions carried out, the military firefighters rescued 5 people in difficulty.\n\nAmong the most relevant missions, we mention:\n\n❗ An intervention that required increased attention from the extrication and first aid crews took place yesterday, in Vrancea county, within the radius of Adjud municipality, DN 2, where military firefighters intervened to manage the aftermath of a road accident between three cars. As a result of the impact, there were three victims, two of whom were incarcerated, in cardio-respiratory arrest. The intervention crews extracted the people stuck in the car and applied resuscitation maneuvers, but to no avail. Our colleagues assisted and medically evaluated the third occupant of the car, who was later transported to the hospital conscious and cooperative.\n\n❗ A complex mission of the military rescuers from the city of Iași took place yesterday when they were asked to intervene in a road accident between a car and a dump truck. Arriving at the place of request, our colleagues found that following the road accident, two victims were incarcerated, one of whom was unconscious in cardio-respiratory arrest. Extrication crews removed the two people from the contorted beasts and SMURD crews applied resuscitation maneuvers. Later, both young people were transported to the hospital for specialized medical assistance.\n\nIn order to cover dynamic missions in the best conditions, 248 rescue firefighters with 159 technical means are at the border with the Republic of Moldova and Ukraine, to manage the influx of people entering the territory of Romania.\n\nIn the future, the rescue firefighters remain mobilized, 24 hours a day, for the operative management of emergency situations and the provision of specialized medical first aid to persons in difficulty.\n\nThe events registered at the national level remain under the attention of the National Operational Center, for the immediate disposition of measures aimed at ensuring the optimization of response missions aimed at saving lives.\n \nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform [https://fiipregatit.ro](link)','2022-10-27 15:48:35.430000','2022-10-29 08:39:06.476000','2022-10-29 08:39:06.468000',1,1,'en'),(11,'IGSU: Missions carried out by rescuers in the last 24 hours','Monday\'s report: 16 people in distress were rescued, and another 1,222 were medically assisted by SMURD crews\n\nYesterday, October 17 this year, was demanding for operative crews from the whole country, the most numerous missions being carried out in the Bucharest-Ilfov area and in the counties of Mureș, Prahova, Constanța and Cluj.\n\nA share of approximately 85% of the total number of interventions consisted in the provision of medical assistance by the SMURD crews (1,206 cases out of a total of 1,435 emergency situations managed).\n\nAlso, rescue firefighters acted to locate and extinguish the 66 fires recorded nationally and promptly managed 159 missions for the protection of communities.\n\nSpecial attention was also paid to road accidents, with rescue crews acting in 4 situations to extract victims stuck in cars.\n\nAt the same time, during the reference period, during the missions carried out, the military firefighters rescued 16 people in difficulty.\n\nIn the last 24 hours, 4 messages warning the population were sent through the RO-ALERT system, 3 of which were messages regarding the presence of wild animals, in the counties of Harghita (2) and Mureș (1); 1 message regarding the disappearance of a minor from home, sent by IGSU, in Bacău county.\n\nAmong the most relevant interventions, we mention:\n\n \n\n❗ A complex mission took place yesterday, in Gorj county, Bumbești-Pițic locality, where the military firefighters were requested to intervene to locate and extinguish a fire that broke out at a house. Arriving at the scene, the fire crews found that the flames were manifesting violently, in a building and two annexes on an area of ​​approximately 180 square meters. During the extinguishing mission, a deceased person was found inside the home. Our colleagues extinguished the flames, removing the danger of spreading to neighboring homes.\n\n❗ An intervention that required increased attention and sustained effort took place throughout the day yesterday, in Buzău county, where operative crews acted to extinguish the flames that broke out at three buildings in the town of Siriu. The extinguishing crews that arrived at the scene of the request found that the burning manifested itself with large releases of smoke, in three buildings, on an area of ​​approximately 200 square meters. During the action to extinguish the fire, the SMURD crews evaluated and provided medical assistance to four people, subsequently three of them were transported to the hospital for specialized medical investigations. The flames were extinguished within the limits found.\n\nIn order to cover dynamic missions in the best conditions, 219 rescue firefighters with 160 technical means are at the border with the Republic of Moldova and Ukraine, to manage the influx of people entering the territory of Romania.\n\nThe rescuers remain in duty for the prompt intervention to the requests of the citizens in difficulty, and the dynamics of the events in the field will be carefully monitored by the National Operational Center, for the immediate disposition of the necessary measures to optimize the response missions.\n\nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform https://fiipregatit.ro','2022-10-27 15:52:58.600000','2022-10-29 08:41:35.788000','2022-10-28 11:37:33.804000',1,1,'en'),(12,'IGSU: Misiunile desfășurate de salvatori, în acest weekend','Weekend solicitant pentru salvatorii din întreaga țară\n\nÎn acest sfârșit de săptămână (14-16.10.2022), la nivel național, pompierii militari au gestionat 3.991 intervenții în situații de urgență. Majoritatea dintre acestea au constat în asistență medicală, echipajele SMURD acționând în 3.345 de solicitări.\n\n \n\nEchipajele operative au intervenit pentru stingerea a 162 de incendii, precum și în alte 462 intervenții în sprijinul comunităților, cum ar fi deblocarea de persoane sau animale, distrugerea muniției neexplodată etc.\n\nDin totalul celor 162 incendii, 65 intervenții au fost la arderi necontrolate (miriști, vegetație uscată și deșeuri menajere), fiind afectate aproximativ 85 ha de teren.\n\nTotodată, echipajele de descarcerare au fost solicitate să intervină la 22 de accidente rutiere, pentru extragerea persoanelor dintre fiarele contorsionate ale autoturismelor. În urma acestor evenimente, 7 persoane și-au pierdut viața.\n\nDe asemenea, în ultimele trei zile, pe timpul misiunilor desfășurate, pompierii au salvat 30 persoane aflate în dificultate.\n\nDintre cele mai importante misiuni gestionate de pompieri, amintim:\n\n❗O intervenție complexă a avut loc vineri, în județul Vaslui, unde echipajele operative au acționat pentru stingerea flăcărilor izbucnite la o casă de pe raza localității Codăești. La sosirea forțelor de intervenție, arderea se manifesta generalizat, pe o suprafață de aproximativ 70 mp. Pe timpul acțiunii de stingere, o victimă a fost găsită decedată, iar echipajul SMURD a asistat medical o persoană, ulterior aceasta fiind transportată la spital. Incendiul a fost lichidat în limitele găsite.\n\n❗O misiune care a presupus efort susținut din partea pompierilor militari din județul Constanța  a avut loc sâmbătă, în municipiul reședință de județ, unde echipajele de stingere au fost solicitate să intervină pentru localizarea și lichidarea unui incendiu produs la Arhiepiscopia Tomisului. Ajunse la fața locului, echipajele operative au constatat că flăcările se manifestau violent, cu degajări mari de fum, la nivelul acoperișului mansardei, pe o suprafață de aproximativ 800 mp. După mai multe ore de luptă cu focul, salvatorii au stins incendiul, eliminând riscul de propagare la întreaga construcție.\n\n❗O intervenție care a presupus efort susținut din partea echipajelor operative a avut loc pe parcursul zilei de duminică, în județul Suceava, localitatea Zvoriștea, unde pompierii militari au fost solicitați să intervină pentru gestionarea unei situații de urgență generată de producerea unui incendiu la o casă. Forțele de intervenție ajunse la locul solicitării au constatat că arderea se manifesta violent, generalizat, la acoperișul casei și anexele gospodărești, cu pericol de propagare la întreaga locuință. Pe timpul misiunii, echipajul SMURD a acordat asistență medicală pentru o victimă, ulterior aceasta a fost transportată la spital. După mai multe ore de luptă continuă cu focul, incendiul a fost lichidat, limitând propagarea la întregul imobil.\n\nConcomitent cu misiunile desfășurate, pompierii acționează în sprijinul autorităților din zonele de graniță și implicit a cetățenilor ucraineni veniți în România, prin operaționalizarea unor tabere mobile în localități din zona de frontieră, transport persoane și ajutoare materiale.\n\nÎn continuare, pompierii salvatori rămân mobilizați, 24 de ore din 24, pentru gestionarea operativă a situaţiilor de urgenţă şi acordarea primului ajutor medical specializat persoanelor aflate în dificultate.\n\nEvenimentele înregistrate la nivel național rămân în atenția Centrului Operațional Național, pentru dispunerea imediată a măsurilor menite să asigure optimizarea misiunilor de răspuns orientate spre salvarea de vieți.\n\nNu uitați! Informații despre modul de comportare în cazul producerii unor situații de urgență pot fi obținute prin accesarea platformei naționale de pregătire în situații de urgență https://fiipregatit.ro','2022-10-29 08:42:49.519000','2022-10-29 08:43:34.556000','2022-10-29 08:42:52.323000',1,1,'ro'),(13,'IGSU: The missions carried out by the rescuers, this weekend','Demanding weekend for rescuers across the country\n\nThis weekend (14-16.10.2022), nationally, military firefighters managed 3,991 interventions in emergency situations. The majority of these consisted of medical assistance, with SMURD crews acting on 3,345 calls.\n\n \n\nThe operational crews intervened to extinguish 162 fires, as well as in 462 other interventions in support of communities, such as unblocking people or animals, destroying unexploded ordnance, etc.\n\nOut of the total of 162 fires, 65 interventions were for uncontrolled burning (stubs, dry vegetation and household waste), affecting approximately 85 ha of land.\n\nAt the same time, rescue crews were requested to intervene in 22 road accidents, to extract people from the contorted beasts of cars. As a result of these events, 7 people lost their lives.\n\nAlso, in the last three days, during the missions carried out, the firefighters rescued 30 people in difficulty.\n\nAmong the most important missions managed by firefighters, we mention:\n\n❗ A complex intervention took place on Friday, in Vaslui county, where operative crews acted to extinguish the flames that broke out at a house within the radius of Codăești. When the intervention forces arrived, the burning was widespread, on an area of ​​approximately 70 square meters. During the extinguishing action, one victim was found dead, and the SMURD crew provided medical assistance to one person, who was later transported to the hospital. The fire was extinguished within the limits found.\n\n❗ A mission that involved a sustained effort by the military firefighters from Constanța County took place on Saturday, in the county seat municipality, where the fire crews were requested to intervene to locate and extinguish a fire at the Archdiocese of Tomis. Arriving at the scene, the operative crews found that the flames were manifesting violently, with large releases of smoke, at the level of the attic roof, on an area of ​​approximately 800 square meters. After several hours of fighting the fire, rescuers extinguished the fire, eliminating the risk of spreading to the entire building.\n\n❗ An intervention that required a sustained effort from the operative crews took place throughout the day on Sunday, in Suceava county, Zvoriștea locality, where the military firefighters were requested to intervene to manage an emergency situation generated by a fire at a house . The intervention forces that arrived at the scene of the request found that the burning was violent, generalized, on the roof of the house and the outbuildings, with the risk of spreading to the entire home. During the mission, the SMURD crew provided medical assistance to a victim, who was later transported to the hospital. After several hours of continuous fire fighting, the fire was extinguished, limiting the spread to the entire building.\n\nSimultaneously with the missions carried out, the firefighters act in support of the authorities in the border areas and implicitly of the Ukrainian citizens coming to Romania, by operating mobile camps in localities in the border area, transporting people and providing material aid.\n\nIn the future, the rescue firefighters remain mobilized, 24 hours a day, for the operative management of emergency situations and the provision of specialized medical first aid to persons in difficulty.\n\nThe events registered at the national level remain under the attention of the National Operational Center, for the immediate disposition of measures aimed at ensuring the optimization of response missions aimed at saving lives.\n\nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform https://fiipregatit.ro','2022-10-29 08:43:34.515000','2022-10-29 08:43:35.489000','2022-10-29 08:43:35.482000',1,1,'en'),(14,'IGSU: Misiuni desfășurate de pompierii militari, la nivel național, în ultimele 24 de ore','Misiunile pompierilor militari din ultimele 24 de ore\n\nEchipajele operative au fost prezente la datorie pentru intervenția imediată la solicitările cetățenilor și gestionarea optimă a situațiilor de urgență produse la nivel național. Stingerea incendiilor, acordarea de prim ajutor, descarcerarea, deblocarea sau salvarea persoanelor și animalelor din medii ostile vieții reprezintă doar câteva exemple dintre cele 1.303 misiuni desfășurate de salvatori, în ultimele 24 de ore (13.10.2022).\n\n \nLa nivel național, 1.088 persoane au primit ajutorul echipajelor SMURD, cele mai multe solicitări de sprijin fiind înregistrate în zona București-Ilfov (233 cazuri), urmată de județele Mureș (59 cazuri), Timiș (58 cazuri) și Cluj(51 cazuri).\n\n \nÎn ultimele 24 de ore, echipajele operative au acționat pentru stingerea celor 57 incendii înregistrate la nivel național și au gestionat cu promptitudine 146 de misiuni pentru protecția comunităților.\n\n \nDin totalul celor 57 de incendii care au avut loc ieri, 23 de intervenții au fost înregistrate la arderi necontrolate (miriști, vegetație uscată, deșeuri menajere), fiind afectate aproximativ 40 ha de teren.\n\n \nDe asemenea, pe parcursul zilei de ieri, pompierii au salvat 20 persoane aflate în dificultate.\n\nTotodată, echipajele de descarcerare au fost solicitate să intervină în 12 cazuri, pentru extragerea victimelor din autoturismele implicate în accidente rutiere. În urma acestor evenimente, 6 persoane și-au pierdut viața în județele Bacău, Bihor și Neamț.\n\nÎn perioada de referință, la nivel național au fost transmise 3 mesaje de avertizare a populației prin sistemul RO-ALERT, dintre care 2 mesaje privind prezența animalelor sălbatice, în județul Harghita și 1 mesaj privind producerea unui incendiu, în județul Ilfov.\n\nDintre cele mai relevante misiuni, amintim:\n\n❗O intervenție complexă a avut loc ieri, în județul Ilfov, pe raza localității Voluntari, unde colegii noștri au intervenit pentru stingerea unui incendiu izbucnit la două depozite în interiorul cărora se aflau materiale lemnoase, recipiente sub presiune și încălțăminte. La sosirea echipajelor de intervenție, arderea se manifesta violent, cu flacără deschisă și degajări mari de fum, pe o suprafață de aproximativ 7.000 mp. Pentru protecția populației din proximitate, din cauza degajărilor mari de fum, a fost emis un mesaj de avertizare RO-ALERT. După mai multe ore de luptă susținută cu flăcările, incendiul a fost lichidat fără a fi înregistrate victime.\n\n❗O altă misiune care a presupus atenție sporită din partea pompierilor militari constănțeni a avut loc ieri, în Eforie Nord, unde echipajele de stingere au acționat pentru localizarea și lichidarea unui incendiu izbucnit la o casă. Forțele de intervenție ajunse la locul solicitării au constatat că arderea se manifesta generalizat, pe o suprafață de aproximativ 90 mp. Pe timpul operațiunilor de stingere din interiorul locuinței au fost extrase o persoană decedată (bărbat, 53 ani) și trei victime conștiente. Colegii noștri au evaluat și asistat medical cele trei persoane, ulterior acestea au fost transportate la spital. Incendiul a fost lichidat în limitele găsite.\n\nPentru acoperirea în cele mai bune condiții a misiunilor din dinamică, 226 pompieri salvatori și 163 mijloace tehnice se află la granița cu Republica Moldova și Ucraina, pentru gestionarea afluxului de persoane care intră pe teritoriul României.\n\nInspectoratele pentru situații de urgență rămân mobilizate pentru a interveni, în cel mai scurt timp, pentru gestionarea operativă a situațiilor de urgență și acordarea de prim ajutor persoanelor aflate în dificultate.\n\nTotodată, evoluția situației din teren va fi atent monitorizată de Centrul Operațional Național al IGSU pentru dispunerea măsurilor imediate care să asigure eficientizarea misiunilor de răspuns.\n\n \nNu uitați! Informații despre modul de comportare în cazul producerii unor situații de urgență pot fi obținute prin accesarea platformei naționale de pregătire în situații de urgență https://fiipregatit.ro\n','2022-10-29 08:44:47.774000','2022-10-29 08:45:29.172000','2022-10-29 08:44:49.810000',1,1,'ro'),(15,'IGSU: Missions carried out by military firefighters, at national level, in the last 24 hours','The missions of the military firefighters in the last 24 hours\n\nThe operative crews were present on duty for the immediate intervention to citizens\' requests and the optimal management of emergency situations produced at the national level. Extinguishing fires, providing first aid, extricating, unlocking or rescuing people and animals from hostile environments are just a few examples of the 1,303 missions carried out by rescuers in the last 24 hours (13.10.2022).\n \n\nAt the national level, 1,088 people received the help of SMURD crews, the most requests for support being registered in the Bucharest-Ilfov area (233 cases), followed by the counties of Mureș (59 cases), Timiș (58 cases) and Cluj (51 cases) .\n \n\nIn the last 24 hours, the operative crews acted to extinguish the 57 fires registered at the national level and promptly managed 146 missions for the protection of communities.\n \n\nOut of the total of 57 fires that took place yesterday, 23 interventions were registered for uncontrolled burning (stubs, dry vegetation, household waste), affecting approximately 40 ha of land.\n \n\nAlso, throughout yesterday, the firefighters rescued 20 people in difficulty.\n\nAt the same time, rescue crews were requested to intervene in 12 cases, to extract victims from cars involved in road accidents. As a result of these events, 6 people lost their lives in the counties of Bacău, Bihor and Neamț.\n\nDuring the reference period, at the national level, 3 messages warning the population were sent through the RO-ALERT system, of which 2 messages regarding the presence of wild animals, in Harghita county and 1 message regarding the occurrence of a fire, in Ilfov county.\n\nAmong the most relevant missions, we mention:\n\n❗A complex intervention took place yesterday, in Ilfov county, within the Voluntari locality, where our colleagues intervened to extinguish a fire that broke out at two warehouses inside which were wooden materials, pressure vessels and shoes. When the intervention crews arrived, the burning was violent, with an open flame and large releases of smoke, on an area of ​​approximately 7,000 square meters. For the protection of the population in the vicinity, due to the large releases of smoke, a RO-ALERT warning message was issued. After several hours of fighting the flames, the fire was extinguished without any casualties.\n\n❗ Another mission that required increased attention from the Constanta military firefighters took place yesterday, in Eforie Nord, where the fire crews acted to locate and extinguish a fire that broke out at a house. The intervention forces that arrived at the scene of the request found that the burning was widespread, on an area of ​​approximately 90 square meters. During the extinguishing operations, one deceased person (man, 53 years old) and three conscious victims were extracted from inside the house. Our colleagues evaluated and medically assisted the three people, later they were transported to the hospital. The fire was extinguished within the limits found.\n\nIn order to cover dynamic missions in the best conditions, 226 firefighters and 163 technical means are on the border with the Republic of Moldova and Ukraine, to manage the influx of people entering the territory of Romania.\n\nThe inspectorates for emergency situations remain mobilized to intervene, in the shortest possible time, for the operative management of emergency situations and the provision of first aid to persons in difficulty.\n\nAt the same time, the evolution of the situation on the ground will be carefully monitored by the National Operational Center of the IGSU in order to arrange immediate measures to ensure the efficiency of the response missions.\n\n\nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform https://fiipregatit.ro','2022-10-29 08:45:29.148000','2022-10-29 08:45:29.148000',NULL,1,1,'en');
