INSERT INTO `courses` VALUES (4,'Traumatism cranio-cerebral la adulți','Ce este o accidentare la cap?\nLeziunile capului sunt una dintre cele mai frecvente cauze de dizabilitate și deces la adulți. Leziunea poate fi la fel de ușoară ca o umflătură, vânătaie (contuzie) sau tăietură pe cap sau poate fi de natură moderată până la severă din cauza unei comoții, tăieturi adânci sau răni deschise, fracturi ale oaselor craniului sau din cauza internei. sângerări și leziuni ale creierului.\n\nO leziune a capului este un termen larg care descrie o gamă largă de leziuni care apar la nivelul scalpului, craniului, creierului și țesutului subiacent și vaselor de sânge din cap. Leziunile capului sunt, de asemenea, denumite în mod obișnuit leziuni cerebrale sau leziuni cerebrale traumatice (TBI), în funcție de amploarea traumei craniene.\n\nLeziunile la cap cresc dramatic - aproximativ 1,7 milioane de oameni au un TBI în fiecare an. Milioane de americani sunt în viață astăzi, care au suferit o accidentare la cap și au nevoie de ajutor pentru activitățile vieții de zi cu zi, costând țara peste 56 de miliarde de dolari pe an.\n\nCare sunt diferitele tipuri de leziuni la cap?\nUrmătoarele sunt câteva dintre diferitele tipuri de leziuni ale capului:\n\nComoție. O comoție cerebrală este o leziune a zonei capului care poate provoca pierderea instantanee a conștientizării sau a vigilenței timp de câteva minute până la câteva ore după evenimentul traumatic.\n\nFractura craniului. O fractură de craniu este o ruptură a osului craniului. Există patru tipuri majore de fracturi de craniu, inclusiv următoarele:\n\nFracturi liniare ale craniului. Acesta este cel mai frecvent tip de fractură de craniu. Într-o fractură liniară, există o rupere a osului, dar nu mișcă osul. Acești pacienți pot fi observați în spital pentru o perioadă scurtă de timp și, de obicei, pot relua activitățile normale în câteva zile. De obicei, nu sunt necesare intervenții.\n\nFracturi de craniu deprimate. Acest tip de fractură poate fi observată cu sau fără tăietură la nivelul scalpului. În această fractură, o parte a craniului este de fapt scufundată în urma traumei. Acest tip de fractură de craniu poate necesita intervenție chirurgicală, în funcție de severitate, pentru a ajuta la corectarea deformării.\n\nFracturi diastatice ale craniului. Acestea sunt fracturi care apar de-a lungul liniilor de sutură în craniu. Suturile sunt zonele dintre oasele capului care fuzionează când suntem copii. În acest tip de fractură, liniile normale de sutură sunt lărgite. Aceste fracturi sunt mai des întâlnite la nou-născuți și sugari mai mari.\n\nFractură bazilară a craniului. Acesta este cel mai grav tip de fractură a craniului și implică o ruptură a osului de la baza craniului. Pacienții cu acest tip de fractură au frecvent vânătăi în jurul ochilor și o vânătaie în spatele urechii. Ei pot avea, de asemenea, lichid limpede care se scurge din nas sau din urechi din cauza unei rupturi a unei părți a acoperirii creierului. Acești pacienți necesită, de obicei, o observare atentă în spital.\n\nHematom intracranian (ICH). Există mai multe tipuri de ICH, sau cheaguri de sânge, în sau în jurul creierului. Diferitele tipuri sunt clasificate după localizarea lor în creier. Acestea pot varia de la leziuni ușoare ale capului până la leziuni destul de grave și care pot pune viața în pericol. Diferitele tipuri de ICH includ următoarele:\n\nHematom epidural. Hematoamele epidurale apar atunci când se formează un cheag de sânge sub craniu, dar deasupra durei, învelișul dur care înconjoară creierul. De obicei provin dintr-o ruptură a unei artere care trece chiar sub craniu numită artera meningeală medie. Hematoamele epidurale sunt de obicei asociate cu o fractură de craniu.\n\nHematom subdural. Hematoamele subdurale apar atunci când se formează un cheag de sânge sub craniu și sub dura, dar în afara creierului. Acestea se pot forma dintr-o ruptură a venelor care merg de la creier la dura sau dintr-o tăietură pe creier însuși. Acestea sunt uneori, dar nu întotdeauna, asociate cu o fractură de craniu.\n\nContuzie sau hematom intracerebral. O contuzie este o vânătaie la nivelul creierului însuși. O contuzie provoacă sângerări și umflături în interiorul creierului în jurul zonei în care a fost lovit capul. Contuziile pot apărea cu fracturi de craniu sau alte cheaguri de sânge, cum ar fi un hematom subdural sau epidural. Sângerarea care apare în interiorul creierului însuși (numită și hemoragie intraparenchimatoasă) poate să apară uneori spontan. Atunci când trauma nu este cauza, cele mai frecvente cauze sunt de lungă durată, hipertensiunea arterială la adulții în vârstă, tulburările de sângerare la copii sau adulți sau utilizarea medicamentelor care provoacă subțierea sângelui sau anumite droguri ilicite.\n\nLeziune axonală difuză (DAI). Aceste leziuni sunt destul de frecvente și sunt de obicei cauzate de tremurarea creierului înainte și înapoi, care se poate întâmpla în accidente de mașină, în urma căderilor sau a sindromului bebelușului scuturat. Leziunile difuze pot fi ușoare, cum ar fi o comoție cerebrală, sau pot fi foarte severe, ca în leziunea axonală difuză (DAI). În DAI, pacientul este de obicei în comă pentru o perioadă prelungită de timp, cu leziuni în multe părți diferite ale creierului.',NULL,'2022-10-21 21:11:49.639000','2022-10-29 09:16:22.506000','2022-10-10 15:50:09.041000',NULL,1,'ro'),(5,'Craniocerebral trauma in adults','What is a head injury?\nHead injuries are one of the most common causes of disability and death in adults. The injury can be as mild as a bump, bruise (contusion), or cut on the head, or can be moderate to severe in nature due to a concussion, deep cut or open wound, fractured skull bone(s), or from internal bleeding and damage to the brain.\n\nA head injury is a broad term that describes a vast array of injuries that occur to the scalp, skull, brain, and underlying tissue and blood vessels in the head. Head injuries are also commonly referred to as brain injury, or traumatic brain injury (TBI), depending on the extent of the head trauma.\n\nHead injuries are rising dramatically--about 1.7 million people have a TBI each year. Millions of Americans are alive today who have had a head injury and now need help with the activities of daily living, costing the country more than $56 billion per year.\n\nWhat are the different types of head injury?\nThe following are some of the different types of head injuries:\n\nConcussion. A concussion is an injury to the head area that may cause instant loss of awareness or alertness for a few minutes up to a few hours after the traumatic event.\n\nSkull fracture. A skull fracture is a break in the skull bone. There are four major types of skull fractures, including the following:\n\nLinear skull fractures. This is the most common type of skull fracture. In a linear fracture, there is a break in the bone, but it does not move the bone. These patients may be observed in the hospital for a brief amount of time, and can usually resume normal activities in a few days. Usually, no interventions are necessary.\n\nDepressed skull fractures. This type of fracture may be seen with or without a cut in the scalp. In this fracture, part of the skull is actually sunken in from the trauma. This type of skull fracture may require surgical intervention, depending on the severity, to help correct the deformity.\n\nDiastatic skull fractures. These are fractures that occur along the suture lines in the skull. The sutures are the areas between the bones in the head that fuse when we are children. In this type of fracture, the normal suture lines are widened. These fractures are more often seen in newborns and older infants.\n\nBasilar skull fracture. This is the most serious type of skull fracture, and involves a break in the bone at the base of the skull. Patients with this type of fracture frequently have bruises around their eyes and a bruise behind their ear. They may also have clear fluid draining from their nose or ears due to a tear in part of the covering of the brain. These patients usually require close observation in the hospital.\n\nIntracranial hematoma (ICH). There are several types of ICH, or blood clots, in or around the brain. The different types are classified by their location in the brain. These can range from mild head injuries to quite serious and potentially life-threatening injuries. The different types of ICH include the following:\n\nEpidural hematoma. Epidural hematomas occur when a blood clot forms underneath the skull, but on top of the dura, the tough covering that surrounds the brain. They usually come from a tear in an artery that runs just under the skull called the middle meningeal artery. Epidural hematomas are usually associated with a skull fracture.\n\nSubdural hematoma. Subdural hematomas occur when a blood clot forms underneath the skull and underneath the dura, but outside of the brain. These can form from a tear in the veins that go from the brain to the dura, or from a cut on the brain itself. They are sometimes, but not always, associated with a skull fracture.\n\nContusion or intracerebral hematoma. A contusion is a bruise to the brain itself. A contusion causes bleeding and swelling inside of the brain around the area where the head was struck. Contusions may occur with skull fractures or other blood clots such as a subdural or epidural hematoma. Bleeding that occurs inside the brain itself (also called intraparenchymal hemorrhage) can sometimes occur spontaneously. When trauma is not the cause, the most common causes are long-standing, high blood pressure in older adults, bleeding disorders in either children or adults, or the use of medications that cause blood thinning or certain illicit drugs.\n\nDiffuse axonal injury (DAI). These injuries are fairly common and are usually caused by shaking of the brain back and forth, which can happen in car accidents, from falls or shaken baby syndrome. Diffuse injuries can be mild, such as with a concussion, or may be very severe, as in diffuse axonal injury (DAI). In DAI, the patient is usually in a coma for a prolonged period of time, with injury to many different parts of the brain.',NULL,'2022-10-29 09:08:08.580000','2022-10-29 09:15:18.862000','2022-10-29 09:15:18.858000',1,1,'en');
