INSERT INTO `tncs` VALUES (1,'Termeni si condiții\n\nDSU este o aplicație web ce poate fi accesată la adresa http://www.dsuapp.ro și care vă permite în baza unui cont de utilizator DSU să creați și să editați informații despre unul sau mai multe profile de date.\n\nAutoarea și titulara dreptului de proprietate intelectuală a DSU este Fundația pentru SMURD, cu sediul social în Târgu Mureș, str. Gheorghe Marinescu  nr. 50, județul Mureș, cod unic de inregistrare (CUI): 20177660. Fundația pentru SMURD a fost înregistrată în Registrul Asociațiilor și Fundațiilor aflat la Grefa Judecătoriei Târgu Mureș sub nr. 7/19.12.2006.      \n\nTermeni și definiții\n\nTermenii de mai jos se vor aplica tuturor utilizatorilor DSU, persoane fizice sau juridice, care accesează aplicația fără a avea un cont de utilizator, precum și deținătorilor unui cont de utilizator DSU.\n\nBeneficiar -  vizitatorii sau utilizatorii fără cont de acces, precum și deținătorii unui cont de utilizator DSU\n\nFurnizor - Fundația pentru SMURD,  autoare și titulară a dreptului de proprietate intelectuală a aplicației DSU și a domeniului www.dsuapp.ro\n\nDSU – aplicație web ce poate fi accesată la adresa www.dsuapp.ro; în cele ce urmează, DSU, Platforma sau Sistemul reprezintă unul și același lucru   \n\nCont de utilizator DSU – cont de utilizator cu drept de a crea și de a edita informații personale ca uitilizator al aplicației  \n\nDrepturi de proprietate intelectuală (DPI) – totalitatea drepturilor imateriale, precum dreptul de autor, know-how-ul, drepturile de bază de date, drepturi de proiectare, drepturi de model, patente, mărci înregistrate și înregistrări ale numelor de domenii\n\n\nConținutul aplicației DSU\n\nBeneficiarul este direct responsabil de orice conținut pe care îl introduce prin intermediul interfeței web DSU.\n\nBeneficiarul este direct responsabil de orice activitate în interiorul Platformei, de creare, editare, modificare sau ștergere de conținut care este făcută sub numele său de utilizator, Furnizorul rezervându-și dreptul de a interveni asupra conținutului respectiv, eliminându-l în cazul în care sunt nerespectate obligațiile prevăzute în prezentul document.\n\nBeneficiarului nu îi este permis să înregistreze în Platformă niciun fel de conținut care este ilegal, necorespunzător realității, dăunător, amenințător, abuziv, hărțuitor, defăimător, pornografic, invaziv în intimitatea altcuiva sau care afectează minorii în orice fel.\n\nBeneficiarului nu îi este permis să înregistreze în Platformă conținut care reprezintă promoții sau oferte la servicii, produse sau orice fel de activități care presupun comercializarea de bunuri sau servicii de-a lungul unei perioade de timp oricât de lungi.\n\nBeneficiarului nu îi este permis să introducă în Platformă conținut care include informații private sau care identifică o terță persoană, fără consimțământul explicit al acesteia.\n\nBeneficiarului nu îi este permis să introducă conținut care este fals, amăgitor, derutant, confuz sau dezinformator.\n\nBeneficiarului nu îi este permis să folosească Platforma în scopuri ilegale sau neautorizate.\n\nÎn cazul în care Beneficiarul nu este cetățean român sau nu domiciliază în România, are obligația de a se supune legilor române în vigoare în ceea ce privește conduita și conținutul admisibile online.\n\nBeneficiarului nu îi sunt permise modificarea, adaptarea sau exploatarea securității Platformei și nici modificarea unui alt website pentru a induce falsa impresie că este asociat cu DSU.\n\nBeneficiarului nu îi sunt permise crearea și trimiterea de emailuri necerute către niciun alt utilizator al Platformei sau aplicațiilor care derivă din ea (“SPAM”).\n\n\nDPI\n\nDSU este protejată de convențiile internaționale și de legislația României referitoare la dreptul de autor, precum și de prevederile comerciale internaționale.\n\nTot continutul, asa cum poate fi văzut sau auzit pe http://www.dsuapp.ro, inclusiv layout-ul grafic, textul, imaginile, ilustrațiile, grafica, clipurile audio sau video sunt părți ale mărcilor de comerț, mărcilor de servicii, drepturilor de copyright și/sau altor drepturi de proprietate intelectuală sau părți ale licențelor detinute de Furnizor sau de partenerii săi sau de alte terțe părți ce au licențiat materialele lor către Furnizor.\n\nSiglele, logo-urile, denumirile de bunuri și servicii, precum și ofertele ce aparțin colaboratorilor Furnizorului sunt proprietatea deținătorilor de drept, iar aceștia au drepturi și obligații depline asupra lor.\n\nBeneficiarul nu poate copia, descărca, reproduce, modifica, distribui, transmite, transfera sau crea lucrări derivative din conținutul DSU, fără a obține permisiunea directă și scrisă din partea Furnizorului.\n\nPrin accesarea site-ului, Beneficiarul se declară de acord să protejeze, să asigure, să apere si să considere nevinovat Furnizorul împotriva tuturor pierderilor, cheltuielilor, prejudiciilor și costurilor rezultate din nerespectarea acestor termeni și condiții de către el.\n\nÎn cazul în  care Beneficiarul sesizează sau consideră că orice material de pe acest site, publicat de Furnizor sau de către altcineva, violează drepturile de copyright sau orice alte drepturi, poate contacta Furnizorul la adresa de email office@fundatiapentrusmurd.ro, pentru ca acesta să ia cât mai rapid o decizie în cunoștință de cauză.\n\n\nConfidențialitate. Publicitate\n\nFurnizorul se angajează să nu transmită datele personale ale Beneficiarilor DSU către terți și să le folosească numai în scopul stabilirii contactului cu clienții săi, precum și în scopul informării acestora asupra aspectelor legate de funcționarea DSU și a ofertelor acesteia.\n\nFurnizorul nu promoveaza SPAM-ul. Orice Beneficiar care a furnizat explicit adresa sa de email în cadrul Platformei, poate solicita stergerea acesteia din baza de date a Furnizorului, printr-o notă scrisă trimisă pe adresa de emailoffice@fundatiapentrusmurd.ro.\n\nConform condițiilor legale privind protecția datelor cu caracter personal, Furnizorul nu va dezvălui fără autorizare nicio informație referitoare la Beneficiar.  \n\nBeneficiarul își asumă respectarea confidențialității informațiilor comunicate de către Furnizor acestuia.\n\nPentru detalii privind politica de confidențialitate a DSU, accesați secțiunea Politica de confidențialitate din cadrul aplicației (butonul „Mai mult”, secvența „Despre aplicație”).\n\nRăspunderea \n\nFurnizorul nu poate fi responsabil pentru daune de orice fel, pe care Beneficiarul sau oricare terță parte o poate suferi ca rezultat al îndeplinirii de către Furnizor a oricăreia dintre obligațiile sale, conform termenilor și condițiilor formulate.\n\n\nForța majoră\n\nNiciuna dintre părți nu va fi răspunzătoare pentru neexecutarea obligațiilor sale, dacă o astfel de neîndeplinire este cauzată de un eveniment de forță majoră. Forța majoră este evenimentul imprevizibil și inevitabil, în afara controlului părților, constatat ca atare conform legislației în vigoare.\n\n\nLegea aplicabilă. Jurisdicția\n\nPrezentul contract este supus legilor române în vigoare. Eventualele litigii apărute între Furnizor și Beneficiar se vor rezolva pe cale amiabilă sau, în cazul în care aceasta nu va fi posibil, litigiile vor fi soluționate de instanțele judecătorești române competente.\n     \n\nDispoziții finale\n\nFurnizorul își rezervă dreptul de a modifica în orice moment termenii și condițiile DSU fără avertizare prealabilă. Orice modificare intră în vigoare imediat, din momentul afișării sale pe site. Aceste modificări nu afectează operațiile anterioare.\n\n\nUltima actualizare: 18 mai 2018','2022-10-26 13:11:03.991000','2022-10-28 11:44:18.646000','2022-10-26 14:08:24.850000',1,1,'ro');
